
<!DOCTYPE html>
<html lang="vi">
<head>
    <meta charset="UTF-8">
    <title>💖 Hello Kitty Dễ Thương 💖</title>
    <style>
        body {
            margin: 0;
            background: linear-gradient(to top right, #ffe6f0, #fdfbfb);
            overflow: hidden;
            font-family: 'Comic Sans MS', cursive;
            text-align: center;
        }

        h1 {
            margin-top: 40px;
            color: #ff4da6;
            text-shadow: 2px 2px 5px rgba(255, 105, 180, 0.4);
            font-size: 32px;
        }

        .kitty {
            position: absolute;
            width: 60px;
            opacity: 0;
            animation: riseAndSlide 6s ease-in-out forwards;
        }

        @keyframes riseAndSlide {
            0% { transform: translateY(100vh); opacity: 0; }
            20% { opacity: 1; }
            50% { transform: translateY(30vh); }
            100% { transform: translate(100vw, 30vh); opacity: 0; }
        }

        #finalWrapper {
            display: none;
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            animation: fadeIn 2s forwards;
            background-color: rgba(255, 240, 250, 0.8);
            padding: 30px;
            border-radius: 30px;
            box-shadow: 0 0 25px rgba(255, 105, 180, 0.3);
        }

        #finalKitty {
            width: 220px;
            margin-bottom: 20px;
            filter: drop-shadow(0 0 10px rgba(255, 105, 180, 0.5));
        }

        #heart {
            font-size: 60px;
            color: red;
            animation: beat 1s infinite;
            cursor: pointer;
        }

        @keyframes beat {
            0%, 100% { transform: scale(1); }
            50% { transform: scale(1.3); }
        }

        .message {
            display: none;
            font-size: 28px;
            color: #d6006e;
            margin-top: 20px;
            animation: fadeIn 1s forwards;
            text-shadow: 1px 1px 3px #fff;
        }

        @keyframes fadeIn {
            from { opacity: 0; }
            to { opacity: 1; }
        }
    </style>
</head>
